import React, { useState, useEffect } from "react";
import Question from "./Question";
import Answer from "./Answer";
import Navigator from "./Navigator";
import { useHistory } from "react-router-dom";
import "../css/Test.css";

function Test({ location }) {
  const history = useHistory();

  useEffect(() => {
    var contactId;

    if (sessionStorage.get("sessionContactId") > 1) {
      console.log(
        "üîê sessionContactId: ",
        sessionStorage.get("sessionContactId")
      );
    } else {
      // Get all URL Params
      const urlParams = new URLSearchParams(location.search);
      // Get contactId From Params
      if (urlParams.has("contactId")) {
        contactId = +urlParams.get("contactId");
      }
      if (contactId !== NaN || contactId !== undefined) {
        sessionStorage.setItem("contactIdSession", contactId);
      } else {
        console.log("üîê contactId is NaN...");
      }
      // Remove contactId From Params
      urlParams.delete("contactId");
      history.replace({
        search: urlParams.toString(),
      });
      console.log("üîê contactId: ", contactId);
    }
  }, []);

  return (
    <div className="test">
      <div className="test-container">
        <div className="test-header">Questions</div>
        <Question />
        <Answer />
        <Navigator />
      </div>
    </div>
  );
}

export default Test;
